import React from "react";
import data from "./data";

function Card(params) {
    return(
        <>
          <h3> welcome to cards </h3>
          <p> {data.map((value)=>{
              return(
                  value.student_name + " " + value.class + " " + value.college + " " + value.marks + " " + value.Image
              );
          })} </p>
        </>
    );
}

export default Card;
